              console.error(error);
          }
        } else {
          console.error('%c 语法错误  ' + extendFile , 'font-size:12pt;color:#860786');
          console.error('%c extendVmName-->org_bd_admindepttree_VM_Extend','font-size:12pt;color:#860786')
        }
        self.execute('extendReady',self);
